import heapq

def entrance(trips, capacity, fuel):
    trips = sorted(trips, key=lambda trip: trip[1])
    heap = []
    for (num_passengers, start, end, fc) in trips:
        fuel += fc * (end - start)
        heapq.heappush(heap, -num_passengers)
        while heap and fuel < 0:
            fuel += -heapq.heappop(heap)
        if fuel < 0:
            return False
    return True

